import React from 'react';

const About = () => {
    return (
        <div>
            <section id="about">
                <div className="container">
                    <div className="row justify-content-center">
                        <div className="col-md-8 mt-5">
                            <h1 className="display-4 fw-bolder mb-4 text-center text-white">About me</h1>
                                <p className="lead text-center fs-4 mb-4 text-white">I'm a photographer based in the Pacific Northwest. I love to capture the beauty of nature through my lens. I'm also a huge fan of the outdoors and love to hike, camp, and explore.</p>
                        </div>
                    </div>
                </div>
            </section>
        </div>
    );
} 

export default About;
